function Edit(props){
    return ( 
        <div>
            <h1>Edit </h1>
            <form action={`/captain/${props.log._id}?_method=PUT`} method="POST">
                <label htmlFor="ste">Ship Title:</label><br />
                <input type="text" id="nme" name="title" defaultValue={props.log.title} /><br /><br />

                <label htmlFor="clr">Ship entry:</label><br />
                <input type="text" id="clr" name="entry" defaultValue={props.log.entry} /><br /><br />

                <label htmlFor="sib">shipisBroken:</label>
                {/* <input type="checkbox" id="rdy" name="shipisBroken" defaultChecked={props.log.shipisBroken} /><br /><br /> */}

                <button>Submit</button>
            </form>
        </div>
    );
}

export default Edit;
